@danibacedo @CCambara2 Lava Jato matou as grandes empresas que demandavam engenheiros e mecânicos, as mais capitalizadas e que se aventuravam a fazer coisas privadas dos WASPS.
Brasileiro não pode fazer avião, plataforma de petróleo, barragem, aeroporto.
Eram essas empresas que geravam demanda p as PME

@matthewbennett No es lo mismo perder el 5% de tus exportaciones que el 50%. A todos nos va a doler, pero mucho. 
Es un duelo suicida donde uno se va a llevar un tiro en el brazo y el otro en el bazo. 
Parecido,  pero no igual.
